	add("ambush", "{\"term\":\"ambush\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"frankish\", \"old french (842-ca. 1400)\"], \"text\":\"From Old french (842-ca. 1400) \u0027embusche\u0027 (noun), \u0027\u0027 \u0027\u0027 (verb), from Old french (842-ca. 1400) {{m|fro|em-}} + \u0027boscus\u0027 from Frankish {{m|frk|*boscu}}, {{m|frk|*busk||bush}}, from Proto-germanic {{m|gem-pro|*busk-||bush, heavy stick}}. Compare \u0027\u0027 The change to \u0027am-\u0027 from earlier forms in \u0027en-\u0027 is unexplained. More at bush.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of concealing oneself and lying in wait to attack by surprise\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An attack launched from a concealed position\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Milto\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Heaven, whose high walls fear no assault or siege / Or \u0027\u0027ambush\u0027\u0027 from the deep\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The troops posted in a concealed place, for attacking by surprise; those who lie in wait\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Bible, Josh. viii. 1\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027ambush\u0027\u0027 arose quickly out of their place\", \"priority\":7}]}, \"synonyms\":{}}");

